custom_css:
.creative_header{
    width: 50%;
    margin: 0 auto;
}
.ourteam_header_title{
    font-weight: 600;
    font-family: outfit;
}
.ourteam_content{
    margin: 20px auto;
    line-height: 30px;
    font-size: 15px;
    font-family: poppins;
    opacity: 0.6;
}
