    bottom: 0;
    top: 0;
    right: 0;
    left: 0;
    color: white;
    background: linear-gradient(180deg,rgba(0,0,0,.0001) 22.84%,rgba(0,0,0,.4) 80.41%,rgba(0,0,0,.6) 97.18%);
